import React from "react";
import { Route, Switch } from "react-router";

import ToDo from "../components/ToDo.js";

export default () => {
  return (
    <Switch>
      <Route exact path="/">
        <div>
          <h1>Welcome in simple ToDo app :)</h1>
        </div>
      </Route>
      <Route path="/todo" component={ToDo} />
    </Switch>
  );
};
